    /* UnitDelay: '<S115>/Unit_Delay2' */
    localB->Unit_Delay2 = localDW->Unit_Delay2_DSTATE;

    /* Product: '<S115>/Product1' */
    localB->Product1 = localB->Subtract1 * localB->Unit_Delay2;

    /* Sum: '<S115>/Add1' */
