    /* Outputs for Atomic SubSystem: '<S115>/If_Then_Else' */
    L4_MABX_If_Then_Else(localB->LogicalOperator, rtu_GPID_control_error,
                         localB->Add1, &localB->If_Then_Else);

    /* End of Outputs for SubSystem: '<S115>/If_Then_Else' */

    /* Product: '<S110>/Divide' */
